import React from 'react';
import Form from './components/Form';
import { Route } from 'react-router-dom';

const App = () => {

  return (
    <div className="App">
      <h1>Health Insurance Premium Calculator</h1>
        <Route exact path="/" element={<Form />}/>

    </div>
  );
};

export default App;
